import TextField, { TextFieldVariants } from "@mui/material/TextField";

type TextInputProps = {
  label: string;
  onChange: () => void;
  fullwidth?: boolean;
  variant?: TextFieldVariants;
  type?: string;
  rows?: number;
};

export const TextInput = ({
  label,
  onChange,
  fullwidth,
  variant,
  type,
  rows,
}: TextInputProps) => {
  return (
    <TextField
      label={label}
      variant={variant}
      fullWidth={fullwidth}
      rows={rows}
      type={type}
      onChange={onChange}
    />
  );
};
